import React, { useState } from 'react';
import styled from 'styled-components'
import { SmallLinkButton } from '../styles/Link'

var HeaderContainer = styled.header`
    display: flex;
    // margin-left: 10em;
    // width: 100%;

    box-shadow: 0 1px 6px 0 rgba(32,33,36,.28);
    height: 72px;
    justify-content: flex-end;
    `;

    var ButtonBox = styled.div`

    padding-top: 15px;
    // width: 60%;

`;

var Header = () => {
    // Declare a new state variable, which we'll call "count"
    //   const [count, setCount] = useState(0);

    return (
        <HeaderContainer>
            <ButtonBox>
                <SmallLinkButton to="csv">Csv Generation</SmallLinkButton>
                <SmallLinkButton to="config">Config Generation</SmallLinkButton>
            </ButtonBox >
        </HeaderContainer>
    );
}

export { Header };
